import "./App.css";

function App() {
  return (
    <main>
      <Header />
    </main>
  );
}

function Header() {
  return (
    <header className="nav">
      <div className="nav-title-container">
        <h1>NAT</h1>
        <h3>Property Services</h3>
      </div>
      <div className="nav-btn-container"></div>
    </header>
  );
}

export default App;
